                    { new Guid("d2236598-154e-4d34-a51b-856a192ffa86"), "What", "Orc", "Orc Shaman", "How can I help?" },
                    { new Guid("d23a3a08-10e7-4ac7-ade3-001de11a6cc7"), "Pissed", "Human", "Archmage", "You'd best stay clear of me, or I'll turn you into a mindless sheep! (Reference to the Sorceress spell Polymorph which turns enemies into sheep)" },
