                    { new Guid("d2d99d8e-09b8-4206-a95b-5c34bcae9f68"), "Pissed", "Human", "Blood Elf Engineer & Worker", "If it's really that urgent, why don't you do it yourself?" },
                    { new Guid("d2ee0605-c813-4a8a-aa8b-a4c8772ea4e1"), "Pissed", "Undead", "Shade", "What I do in death echoes in eternity. (Reference to Maximus in Gladiator)" },
