                    { new Guid("d608eac2-0673-478c-8067-c54e9b1017f5"), "Pissed", "Elf", "Demon Hunter", "Darkness called… But I was on the phone, so I missed him. I tried to *69-Darkness, but his machine picked up. I yelled Pick up the phone, Darkness!, but he ignored me. Darkness must have been screening his calls. (Referenced by numerous Undead. The first part, Darkness called, might also be a reference Thriller by Michael Jackson.)" },
