                    { new Guid("dbcb42d8-6935-47e9-b544-df829315867a"), "Pissed", "Elf", "Hippogryph Rider", "The hippogryph is an amazing creature rarely seen outside the wild. The tricky thing about hippogryphs is their incredible jaw strength. One terrible clamp of their beaks can rip a huge beast apart in seconds. Let's see what happens when I stick my hand... *hippogryph attacks* Ah! (A reference to The Crocodile Hunter)" },
