                    { new Guid("de20fc8f-1b8c-4ba0-a8fd-960395cea2cd"), "Yes", "Human", "Gryphon Rider", "You're the boss." },
                    { new Guid("deee7777-e6e4-4b0e-9694-cbcb338fe84d"), "Attack", "Undead", "Acolyte", "Death shall reign." },
